import api from './api';

export const userService = {
  async getSemesterContent() {
    try {
      const response = await api.get('/user/content');
      return response.data;
    } catch (error) {
      console.error('Error fetching semester content:', error);
      return { notes: [], timetables: [], importantNotes: [], mcqTests: [] };
    }
  }
};
